ï»¿import React from 'react';
import {SceneActions} from '../../../stores/scene-store.jsx';

export default React.createClass({
  handlePlay(e) {
    e.preventDefault();

    SceneActions.transition(<ProgramListItem />);
  },

    render() {
        return (
            <div style = " padding: 20px; ">
                <div style = "border: 2px solid; padding: 20px; " >
                    <img src={this.programImage} style = " width:100px; height:100px; border-radius: 50%; border: 2px solid; padding: 10px;"/>
                    <h1>Test Name Here</h1>
                    <button onClick={this.handlePlay}>Play</button>
                </div>
            </div>
        );
    }
});
